import React from 'react';
import Navbar from './Navbar/Navbar';
import './Index.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';


function Portfolio() {
  return (
    <>
      <Router>
        <Routes>
          <Route path='/' element={<Navbar/>} />
        </Routes>
      </Router>
    </>
  )
}

export default Portfolio
